(121, 'https://guardian.co.tt/news/police-swoop-down-on-grande-vendors-6.2.853653.29c1775abe', 'Police swoop down on Grande vendors - Trinidad Guardian', 'Municipal police officers scooped down on vendors selling their goods along the sidewalk in Sangre Grande today.  Vendors were asked by the police to remove their goods or have it confiscated.', '', 0),
