(125, 'https://guardian.co.tt/news/para-los-migrantes-venezolanos-6.2.853364.cbe9f83840', 'Para los migrantes Venezolanos: - Trinidad Guardian', 'Cualquier Venezolano que llega dos semanas antes del proceso de registraciÃƒÂ³n puede postularse a vivir y trabajar aquÃƒÂ­ hasta que un aÃƒÂ±o. El Ministerio de la Seguridad Nacional Stuart Young lo confirmÃƒÂ³ cuando ÃƒÂ©l dio algunos detalles en cuanto al desarrollo del proceso de registraciÃƒÂ³n entre 31 de Mayo y 15 de Junio.', '', 0),
(126, 'https://guardian.co.tt/news/sat-gets-leave-to-sue-ttps-6.2.853352.015cce94b1', 'Sat gets leave to sue TTPS - Trinidad Guardian', 'CenÃ‚Â­tral BroadÃ‚Â­castÃ‚Â­ing SerÃ‚Â­vices and Sanatan Dharma MaÃ‚Â­ha SabÃ‚Â­ha (SDMS) secÃ‚Â­reÃ‚Â­tary genÃ‚Â­erÃ‚Â­al SatÃ‚Â­narayan MaÃ‚Â­haraj have been given the green light to sue the T&T PoÃ‚Â­lice SerÃ‚Â­vice (TTPS) over its failÃ‚Â­ure to disÃ‚Â­close the warÃ‚Â­rant used to search RaÃ‚Â­dio and TV JaagriÃ‚Â­ti, in April. ', '', 0),
(127, 'https://guardian.co.tt/news/man-gets-almost-1m-in-2-years-for-police-prosecution-6.2.853345.e1676c0c96', 'Man gets almost $1m in 2 years for police prosecution - Trinidad Guardian', 'For the second time in less than two years, the State will have to pay a Claxton Bay man compensation for malicious prosecution at the hands of the police. ', '', 0),
(128, 'https://guardian.co.tt/news/migrant-family-pleads-for-medicine-6.2.853343.36f13a1e8d', 'Migrant family pleads for medicine - Trinidad Guardian', 'Having endured a gruelling boat ride from Tucupita to Trinidad and then several days of hiding in the forests of Palo Seco before they were arrested, 17 Venezuelans have found a place to call home at Morne Diablo, Penal.', '', 0),
(129, 'https://guardian.co.tt/news/a-new-culture-at-tcl-6.2.853347.90ef3eb7fd', 'A new culture at TCL - Trinidad Guardian', 'Workers at Trinidad Cement Limited (TCL) used to be enticed to attend work only because of money, but now they go to work because of pride.', '', 0),
(130, 'https://guardian.co.tt/news/venezuelans-in-court-for-illegal-entry-6.2.852965.ab591d584e', 'Venezuelans in court for illegal entry - Trinidad Guardian', ' Even as aid is being sought for more 100 Venezuelans migrants found hiding in the Palo Seco area, 46 others appeared in court this morning charged with entering the country illegally. ', '', 0),
(131, 'https://guardian.co.tt/news/cops-search-laventille-for-escapees-6.2.852935.b33dcef4c2', 'Cops search Laventille for escapees - Trinidad Guardian', 'Several arms of law enforcement including the army spent several hours in Laventille this morning in an anti-crime exercise hoping to flush out prison escapees Denbow Olatungi and Michael Findlay.', '', 0),
