(137, 'https://guardian.co.tt/business/heritage-makes-half-billion-in-four-months-6.2.828727.2c2c41a60f', 'Heritage makes half billion in four months - Trinidad Guardian', 'Heritage Petroleum, the company that acquired the exploration and production assets of the failed Petrotrin, has made an after-tax profit for the first four months of its operations of approximately $565 million.', '', 0),
(138, 'https://guardian.co.tt/sports/anthony-lyons-double-up-on-opening-night-6.2.853294.11a95eb0f5', 'Anthony, Lyons double up on opening night - Trinidad Guardian', 'Zoe Anthony and Cadell Lyons both won two events each on the opening night of the  National Open Long Course Swimming Championships at the National Aquatic Centre, in Balmain, Couva on Thursday night.', '', 0),
(139, 'https://guardian.co.tt/sports/tobago-stops-pos-domination-6.2.853249.6977e2e8fe', 'Tobago stops PoS domination - Trinidad Guardian', 'In front a big crowd headed by the Minister of Education Anthony Garcia, Minister in the Ministry of Education Dr Lovell Francis, Olympic gold medallist Hasely Crawford, National Association Athletics Association (NAAA) president Ephraim Serrette and Atlantic Sports Ambassador Merissa Aguilleira, Tobago stopped the domination of Port-of-Spain and Environs Education District at the Atlantic National Primary School Track and Field Championships.', '', 0),
(140, 'https://guardian.co.tt/sports/motul-monster-receives-uim-record-certificate-6.2.853233.4a7e16e00d', 'Motul Monster receives UIM Record Certificate - Trinidad Guardian', 'The T&T Powerboat Racing Association (TTPBA) hosted a private ceremony to present the Motul Monster team with their Union Internationale Motonautique (UIM) Record Certificate. ', '', 0),
(141, 'https://guardian.co.tt/sports/stampfli-moves-on-in-classic-6.2.852620.e374d23363', 'Stampfli moves on in Classic - Trinidad Guardian', 'Breana Stampfli was the lone T&T player to advance to the next round of the International Tennis Federation\'s (ITF) Hibiscus Classic US$15, 000 Professional Tournament at the National Racquet Centre (NRC) in Tacarigua yesterday. ', '', 0),
(142, 'https://guardian.co.tt/life/horrors-in-a-venezuelan-jail-6.2.853176.097a2003a7', 'Horrors in a Venezuelan jail - Trinidad Guardian', 'Life in T&T\'s prison facilities may seem unbearable to inmates but not for Icacos fisherman Candy Edwards who says T&T\'s jails are a sanctuary compared to the horrific Venezuelan jails controlled by ruthless organised criminals.', '', 0),
(143, 'https://guardian.co.tt/article/full-house-at-o2n-style-2-panel-discussion-on-creative-economy-6.2.853117.3b1a0994aa', 'Full House at O2N Style 2 Panel Discussion on Creative Economy - Trinidad Guardian', 'Over 400 creative industry professionals and enthusiasts flocked to the Hyatt Regency Trinidad on Monday evening for a riveting discussion on Ã¢Â€ÂœDeveloping the Creative Economy.Ã¢Â€Â The dynamic dialogue, co-hosted by Caribbean Fashion Evangelist Richard Young and Nicole Dyer-Griffith, was a part of the O2N Style 2: Style Me Caribbean experience, which has expanded in its second incarnation to a one-week event tourism festival that celebrates the regionÃ¢Â€Â™s inherent traditions.', '', 0),
(144, 'https://guardian.co.tt/life/trini-ready-to-shine-at-world-championship-of-performing-arts-6.2.852246.f0677a14bf', 'Trini ready to shine at World Championship of Performing Arts - Trinidad Guardian', 'Talented singers, musicians, dancers, artists, actors and models from more than 70 countries across the US, Canada, Caribbean, Central and South America, Europe, Asia, and Africa will be competing in the World Championship of the Performing Arts (WCOPA), considered the Olympics for the performing arts, from July 12-23, 2019, in Long Beach, California, USA.', '', 0),
(145, 'https://guardian.co.tt/article/the-reality-of-what-is-and-what-i-want-it-to-be-6.2.850348.71c9d7171b', 'The reality of what is and what I want it to be - Trinidad Guardian', 'Over the years, IÃ¢Â€Â™ve been talking to clients about what they look for in a caregiver/nurse. Last week, you read all about the roles and responsibilities that they should generally embody in this specialised career. ', '', 0),
(146, 'https://guardian.co.tt/opinion-6.2.838781.65701f99c9', ' - Trinidad Guardian', '', '', 0),
(147, 'https://guardian.co.tt/article/economic-lessons-venezuelas-experience-6.2.838226.7809114171', 'Economic Lessons: Venezuela\'s experience - Trinidad Guardian', 'Venezuela has the highest proven oil reserves in the worldÃ¢Â€Â”some 300 billion barrels, greater even than Saudi Arabia. Notwithstanding its wealth, Venezuela has oscillated between periods of boom and adjustment and coups which track periods of austerity.  Today, however, Venezuelans are suffering the impact of a man-made economic and humanitarian crisis. The economy shrunk by half between 2014 and 2018. The IMF predicts that inflation will hit 1.37 million per cent in 2019 and that real GDP will decrease', '', 0),
(148, 'https://guardian.co.tt/article/money-laundering-and-the-real-terrorist-part-2-6.2.817662.dcba5bbd92', 'Money laundering and the real terrorist (Part 2) - Trinidad Guardian', 'The term \"money laundering\" was pronounced on the global psyche immediately following New YorkÃ¢Â€Â™s 9/11 attacks. Since America claimed this nefariously well-executed attack was perpetrated by 19 Arab terrorists financed through $400,000 of simple money transfers, it introduced and executed heavy-handed dictatorial policies compelling the entire world to comply with its new dictates, unmindful if not uncaring of the destabilising implications slowing the economic progress of small and developing Caribbean', '', 0),
(149, 'https://guardian.co.tt/opinion/storming-the-venezuela-debate-6.2.809865.f2cd9ccdc7', 'Storming the Venezuela debate - Trinidad Guardian', 'As irresistible as the temptation to subject the Prime Minister\'s full-page ad on Sunday to Common Entrance standards (as it has), there is something in the message to which much more attention needs to be paid.', '', 0),
(150, 'https://guardian.co.tt/section-6.30.4b3b2a8134', 'News', '', '', 0),
(151, 'https://guardian.co.tt/news/attorney-says-judge-erred-in-law-6.2.853327.80a6be1b3f', 'Attorney says Judge erred in law - Trinidad Guardian', ' A week after being found in contempt of court and fined $10,000, attorney Cherry Ann Rajkumar has filed an appeal claiming that the judge erred in law.  ', '', 0),
(152, 'https://guardian.co.tt/news/comfort-coming-with-venezuelans-health-in-mind-6.2.853309.ec74e299f8', '\'Comfort\' coming with Venezuelans\' health in mind - Trinidad Guardian', 'The US Navy hospital ship \'Comfort\' will visit Trinidad and Tobago soon during its upcoming medical support mission to Latin America to help tackle humanitarian crisis created by the influx of Venezuelan migrants, the US Southern Command said in a press release on Friday.', '', 0),
(153, 'https://guardian.co.tt/section-6.32.bd515d9edf', 'Business', '', '', 0),
(154, 'https://guardian.co.tt/business/tha-finance-secretary-tobagos-economy-doing-fairly-good-6.2.816717.3a03715a0e', 'THA Finance Secretary :TobagoÃ¢Â€Â™s economy doing Ã¢Â€Â˜fairly goodÃ¢Â€Â™ - Trinidad Guardian', 'TobagoÃ¢Â€Â™s economy has been growing at an annual rate of three per cent over the last five years, according to the Finance Secretary in the Tobago House of Assembly Joel Jack.', '', 0),
(155, 'https://guardian.co.tt/business/subhas-ramkhelawan-tt-technically-out-of-recession-6.2.816719.fa714763bb', 'Subhas Ramkhelawan: T&T technically out of recession - Trinidad Guardian', 'Trinidad and Tobago has not been in a recession for the last year and instead the economy has settled at a lower level, according to the managing director of Bourse Securities, Subhas Ramkhelawan.', '', 0),
(156, 'https://guardian.co.tt/business/tha-to-move-away-as-top-employer-6.2.815017.f2b2e68e29', 'THA to move away as top employer - Trinidad Guardian', 'Chief Secretary of the Tobago House of Assembly Kelvin Charles has said the continued employment by the THA of 60 per cent of the workers in Tobago is not sustainable.', '', 0),
