(1124, 'https://www.cnc3.co.tt/news/chief-justice-threatens-sue-ian-alleyne', 'Chief Justice threatens to sue Ian Alleyne | CNC3', 'Chief Justice Ivor Archie is taking on Crimewatch host Ian Alleyne and the synergy entertainment network for defamation and breach of privacy. It all relates to the stations broadcast of footage and comments made by Alleyne. Urvashi Tiwarie Roopnarine reports.', '', 0),
(1125, 'https://www.cnc3.co.tt/news/aripero-takes-stand', 'Aripero takes a stand | CNC3', 'Another day of blocked roads in south Trinidad as residents of Aripero in Rousillac burnt debris to highlight what they say is constant neglect in their community. But their member of parliament believes that neglect is coming from the regional corporation. Akash Samaroo and cameraman Ivan Toolsie bring us the story.', '', 0),
(1126, 'https://www.cnc3.co.tt/news/sportt-company-fires-5', 'Sportt Company fires 5 | CNC3', 'Three months after an audit was ordered into the Sportt Company, five employees of the organisation have been sent home. The decision comes after a draft report was submitted to the office of the attorney general, but very little information is forthcoming about the findings.', '', 0),
(1127, 'https://www.cnc3.co.tt/press-release/matt-breach-journalistic-principles-led-crime-watchs-demise', 'MATT: Breach of journalistic principles led to Crime Watch\'s demise | CNC3', 'The Media Association of Trinidad and Tobago (MATT) has responded to the termination of the Crime Watch programme on CNC3, saying it\'s view is that a breach of journalistic principles ultimately led to the demise of the show. MATT says it hopes that journalistic best practice is adopted, if the show is to be resumed. The following is MATT\'s statement: SEE ALSO: Ian Alleyne calls for peace; thanks Guardian Media for giving him platform for Crime Watch \"Yesterday CNC3 became the third successive media house t', '', 0),
(1128, 'https://www.cnc3.co.tt/press-release/water-disruptions-golden-grove-sangre-grande-tuesday', 'Water disruptions from Golden Grove to Sangre Grande on Tuesday | CNC3', 'The Water and Sewerage Authority is advising customers in parts of North East Trinidad, served by the North Oropouche Water Treatment Plant that there will be an interruption in their water supply on Tuesday 6th September 2016 between the hours of 6:00 a.m. and 12:00 midnight. The Authority says his has become necessary in order to facilitate electrical upgrade works at the plant. The affected areas will include: * Sangre Grande (Town) * Vega De Oropouche * Toco Road, Sangre Grande * Sangre Chiquito * Manza', '', 0),
(1129, 'https://www.cnc3.co.tt/press-release/double-murder-belmont', 'Double murder in Belmont | CNC3', 'Police are investigating two murders in Belmont Thursday night. The victims have been identified as 34-year-old William Louis and 23-year-old Rahim Marshall. They were both shot dead in the street. Residents of Roget Place heard several long explosions and called the police. Police found the two men lying on the ground suffering from several multiple gunshot wounds. FOR MORE TOP STORIES: http://www.cnc3.co.tt/latest-news', '', 2),
(1130, 'https://www.cnc3.co.tt/press-release/crime-watch-programme-ends-cnc3', 'Crime Watch programme ends on CNC3 | CNC3', 'The Crimewatch programme will no longer be aired on CNC3. The following is a statement from the management of Guardian Media Limited: \"We announce today with regret that CNC3 will no longer carry the Crimewatch programme hosted by Ian Alleyne. Following accuracy issues identified in some of Mr. Alleyneâ€™s reports, Crimewatchâ€™s live episodes were substituted by repeats pending investigation. Since then, we have held conversations with him and his attorney in an attempt to discuss claims of inaccuracy in h', '', 0),
(1131, 'https://www.cnc3.co.tt/press-release/florida-prepares-life-threatening-hurricane', 'Florida prepares for \"life-threatening\" hurricane | CNC3', 'Florida\'s governor has issued a stern warning for a state that hasn\'t had a hurricane landfall for a decade: Hermine, expected to hit the eastern Panhandle by early Friday, could be memorably dangerous. Now spinning across the Gulf of Mexico, Hermine became a Category 1 hurricane and is expected to slam into the Big Bend region of Florida\'s Gulf Coast about midnight, bringing potentially deadly storm surges of up to 8 feet along with heavy rain, the National Hurricane Center said. When Hermine makes its lan', '', 0),
(1132, 'https://www.cnc3.co.tt/press-release/police-swoop-down-grande-vendors', 'Police swoop down on Grande vendors | CNC3', 'MuÂ­nicÂ­iÂ­pal poÂ­lice ofÂ­fiÂ­cers swooped down on venÂ­dors sellÂ­ing their goods along the sideÂ­walk in SanÂ­gre Grande yesÂ­terÂ­day. VenÂ­dors were asked by the poÂ­lice to reÂ­move their goods or have it conÂ­fisÂ­catÂ­ed. Some venÂ­dors hurÂ­riedÂ­ly packed their goods and reÂ­moved their stalls to avoid their goods beÂ­ing conÂ­fisÂ­catÂ­ed, while othÂ­ers gave the poÂ­lice stiff opÂ­poÂ­siÂ­tion. As a reÂ­sult, one venÂ­dor had some of her goods conÂ­fisÂ­catÂ­ed. UpÂ­set shopÂ­pers and memÂ­ber', '', 0),
(1133, 'https://www.cnc3.co.tt/press-release/mickela-panday-launches-patriotic-front', 'Mickela Panday launches Patriotic Front | CNC3', '\"Itâ€™s Time.\" That\'s the word from forÂ­mer Oropouche-West MP MickÂ­ela PanÂ­day. With the genÂ­erÂ­al elecÂ­tion due in 16 months, this is the mesÂ­sage that T&Tâ€™s newest poÂ­litÂ­iÂ­cal parÂ­ty lead by PanÂ­day is sendÂ­ing out as it promisÂ­es to revÂ­oÂ­luÂ­tionise govÂ­erÂ­nance by putting youths at the foreÂ­front. The PaÂ­triÂ­otÂ­ic Front held its launch in ChÂ­aguaÂ­nas toÂ­day and was conÂ­fiÂ­dent of formÂ­ing the next govÂ­ernÂ­ment. \"Itâ€™s a long time in polÂ­iÂ­tics, one year and four mont', '', 0),
(1134, 'https://www.cnc3.co.tt/press-release/last-two-escapees-held', 'Last two escapees held!! | CNC3', 'The two last prison escapees have been recaptured. Olatungi Denbow and Michael Findley were held by a joint team representing the Special Operations Respond Team (SORT) and the Trinidad and Tobago Defence Force, just before 6pm today. They were recaptured in South Oropouche, just before Moruga. Authorities say the men were making plans to travel to Venezuela when they were captured. The exact circumstances surrounding their recapture are not yet clear but we will have further updates later. Up until Friday,', '', 0),
(1135, 'https://www.cnc3.co.tt/news/5-ways-use-leftover-rice-0', '5 Ways To Use Leftover Rice | CNC3', 'Having leftover rice from Chinese food you ordered or even from your Sunday lunch is a common occurrence. Most times it stays dried out in the fridge or you endure the dryness of the rice and eat with another meal. However, sad rice leftovers should not be the case. Stale rice is a key ingredient for many delicious dishesâ€”most of which, do not take extremely long to make. Itâ€™s really up to you if you would like to spend an extra half hour for an amazing dish or suffer through a pretty mediocre one.  Whi', '', 0),
(1136, 'https://www.cnc3.co.tt/news/5-ways-use-leftover-rice', '5 Ways To Use Leftover Rice | CNC3', 'Having leftover rice from Chinese food you ordered or even from your Sunday lunch is a common occurrence. Most times it stays dried out in the fridge or you endure the dryness of the rice and eat with another meal. However, sad rice leftovers should not be the case. Stale rice is a key ingredient for many delicious dishesâ€”most of which, do not take extremely long to make. Itâ€™s really up to you if you would like to spend an extra half hour for an amazing dish or suffer through a pretty mediocre one.  Whi', '', 0),
(1137, 'https://www.cnc3.co.tt/press-release/el-gobierno-anuncia-los-detalles-del-proceso-de-registraci%C3%B3n-para-los-venezolanos', 'El gobierno anuncia los detalles del proceso de registraciÃ³n para los Venezolanos | CNC3', 'Para los migrantes Venezolanos: Cualquier Venezolano que llega dos semanas antes del proceso de registraciÃ³n puede postularse a vivir y trabajar aquÃ­ hasta que un aÃ±o. El Ministerio de la Seguridad Nacional Stuart Young lo confirmÃ³ cuando Ã©l dio algunos detalles en cuanto al desarrollo del proceso de registraciÃ³n entre 31 de Mayo y 15 de Junio. Ayer, Young dio detalles de la registraciÃ³n a la oficina principal del Ministerio de la Seguridad Nacional que estÃ¡ situada en la calle Abercromby, despuÃ©s ', '', 0),
