(1144, 'https://www.cnc3.co.tt/about-us', 'About Us | CNC3', 'CNC3 was initially launched as a cable-only news service in September 2005, as Cable News Channel 3, with its output consisting mainly of News and Current Affairs. In 2008, CNC3 obtained a free to air license, becoming one of the mainstream national broadcasters, operating on channels 12, 14 and 22. Potentially, it can reach all 400,000+ households in Trinidad and Tobago, with its signal extending into Grenada. Beyond its free to air presence, CNC3 is available on all T&Tâ€™s leading cable and satellite ser', '', 0),
