(1146, 'https://www.cnc3.co.tt/press-release/comfort-coming-venezuelans-health-mind', '\'Comfort\' coming with Venezuelans\' health in mind | CNC3', 'The US Navy hospital ship \'Comfort\' will visit Trinidad and Tobago soon during its upcoming medical support mission to Latin America to help tackle humanitarian crisis created by the influx of Venezuelan migrants, the US Southern Command said in a press release on Friday. The ship will make port calls in 11 countries in total. \"Comfort medical teams will pull in to Colombia, Costa Rica, Dominican Republic, Ecuador, Grenada, Haiti, Jamaica, Panama, Saint Lucia, St. Kitts and Nevis, and Trinidad and Tobago fo', '', 0),
(1147, 'https://www.cnc3.co.tt/press-release/pregnant-woman-baby-among-17-venezuelans-found-abandoned-chatham-hotel', 'Pregnant woman, baby among 17 Venezuelans found in abandoned Chatham hotel | CNC3', 'Seventeen Venezuelans have been caught hiding in an abandoned hotel infested with bats and rats at Chatham South beach. They were picked up by the T&T Coast Guard after dawn, having been dropped off by a Venezuelan pirogue. Among the 17 Venezuelans were nine females, one of whom is pregnant, a baby and seven men. A source said the women were hiding in the abandoned hotel; while some were found in the bushes and on the beach. The patrolling officers became alerted when they saw a few cars, waiting to pick up', '', 0),
(1148, 'https://www.cnc3.co.tt/press-release/us-ambassador-observes-his-first-us-memorial-day-tt', 'US Ambassador observes his first US Memorial Day in T&T | CNC3', 'US Ambassador Joseph Mondello, today participated in his first Memorial Day observances here in Trinidad and Tobago. Mondello, a military veteran, on Friday led the staff of the US Embassy Port-of-Spain in observing a moment of silence and laid a wreath to commemorate Memorial Day, observed in the United States on the last Monday in May. Ambassador Mondello said the day symbolized much more to him than the first day of summer, as he recalled reading the list of war casualties in the newspapers as a young bo', '', 0),
(1149, 'https://www.cnc3.co.tt/press-release/146-million-weed-destroyed-biche', '$14.6 million in weed destroyed in Biche | CNC3', 'Police have destroyed marijuana trees and dried marijuana worth an estimated $14.6 million. Officers of the Eastern Division conducted an eradication exercise in Biche on Friday when the drugs were found. The exercise was coordinated by Snr. Supt. (Ag.) Andy Belfon and included officers of the Organised Crime and Intelligence Unit and the Air Support Unit. During the exercise, officers discovered four marijuana fields on approximately nine lots of land, which contained a total of 14,300 fully grown marijuan', '', 0),
(1150, 'https://www.cnc3.co.tt/press-release/venezuelan-families-seek-help', 'Venezuelan families seek help | CNC3', 'Having endured a grueling boat ride from Tucupita to Trinidad and then several days of hiding in the forests of Palo Seco before their arrests, 17 Venezuelans have finally settled into a house at Morne Diablo, Penal. They have limited food, a trickle of water and no medicine for their sick children. Yet to them Trinidad is like a paradise. Compared to their homeland, there is no shortage of food here. The family gave Guardian Media an exclusive interview of their plight and their hopes for the future. The f', '', 0),
(1151, 'https://www.cnc3.co.tt/press-release/police-want-help-finding-teenager-missing-may-2', 'Police want help finding teenager missing since May 2 | CNC3', 'Police are seeking the urgent assistance of the public in locating 18-year-old Rachel Barhoo. Barhoo, of Beckles Street, North Esperance, was last seen in the San Fernando district around 8:30 am on Thursday 2nd May, 2019. She was reported missing to the San Fernando Police Station, around 1 pm, on Wednesday 22nd May, 2019, by her mother. She is of East Indian descent, 5 feet 5 inches tall and medium built with a brown complexion and short black hair. She was last seen wearing a black t-shirt, a pair of blu', '', 0),
