(1164, 'https://www.cnc3.co.tt/news/awareness-does-not-work-behaviour-change-does', 'Awareness Does Not Work, Behaviour Change Does. | CNC3', 'By Leah Lewis, MPH  Tom Ato is 47 years old and his favourite snack is salted prunes. He is invited to a community health fair and obligingly, he goes to the nicely decorated venue with his wife and two children, where music is pumping and smiling faces are all around. While there, he sees the â€˜Healthy Heartâ€™ booth, and so out of sheer curiosity, he gets his blood pressure checked by the volunteer nurse. Tomâ€™s reading that day indicates that his blood pressure is a bit elevated and the nurse advises h', '', 0),
(1165, 'https://www.cnc3.co.tt/news/impact-sleep-health', 'The Impact of sleep on health | CNC3', 'Doctor Visham Bhimull  In Trinidad and Tobago, heart disease and motor vehicular accident (MVA) are two leading causes of death. What is seldom highlighted, though, is the role of sleep deprivation and sleep disorders in increasing the likelihood of these two causes of mortality. Inadequate sleep and sleep disorders have consequences in these two major domains: excessive sleepiness with behavioral consequences, leading to risk including increased rate of motor vehicular crashes; and metabolic consequences, ', '', 0),
(1166, 'https://www.cnc3.co.tt/news/what-you-eat-important-definitely-not-everything', 'What You Eat is Important but Definitely Not Everything | CNC3', 'Kaylan Bartholomew - Health Coach  The global wellness industry is estimated at US$4 trillion and most of it is focused on how a personâ€™s body looks on the outside. In addition, a lot of what we see in the media about health is black and white - You are healthy if you are slim, fit and drink green juice and you are unhealthy if you do not. The reality is that true wellness comes when we feel good on the inside and our mind, body and spirit are in harmony. In addition, there is a spectrum of foods, lifesty', '', 0),
(1167, 'https://www.cnc3.co.tt/news/teen-mental-health', 'Teen Mental Health | CNC3', 'How to Recognise Anxiety in Teenagers The hidden signs and how to approach it.  Arnold Best Most adults seem to believe that teenagers donâ€™t go through, or should have, any stress. They would say, â€œThey have a roof over their heads,â€ or, â€œThey donâ€™t have to go out to work everyday, so why should they be stressed?â€ Let me share a little secret with you...(*cue a whispering voice*) sometimes they do!  Is your teen often flustered, irritable or completely exhausted? Is he or she hesitant to go to s', '', 0),
(1168, 'https://www.cnc3.co.tt/news/pca-begins-investigation-deadly-police-involved-shooting-carenage', 'PCA begins investigation into deadly police-involved shooting in Carenage | CNC3', 'Investigators from the Police Complaints Authority have begun their probe into the deadly police-involved shooting in Carenage, which claimed the life of three people including a teenaged girl and left a police officer injured. As Otto Carrington tells us, residents say they are hoping the PCA would help them in getting the justice they so badly seek.', '', 0),
(1169, 'https://www.cnc3.co.tt/news/single-mother-saving-me-not-option', 'Single mother: Saving for me is not an option | CNC3', 'In this mid-year budget review segment, we feature Rhonda Manwaring. A single mother of two who struggles to make ends meet despite a steady job in the legal fraternity. Our team of reporter Carisa Lee and camerawoman Krystle James share how current economic factors affect how she provides for her special needs son and two-year-old daughter.', '', 0),
(1170, 'https://www.cnc3.co.tt/news/water-truck-bobol', 'Water truck bobol | CNC3', 'Have you ever been charged by a WASA-contracted water truck for the delivery of water? Well, the public utilities minister says this is illegal and it\'s becoming a norm. But he wants victims of this exploitation to make detailed reports so they could fire those responsible. Akash Samaroo has more.', '', 0),
(1171, 'https://www.cnc3.co.tt/news/lisa-marie-daniel-%E2%80%93-woman-behind-fashion-tt', 'Lisa-Marie Daniel â€“ The Woman Behind Fashion TT | CNC3', 'Lisa-Marie Daniel is no typical woman; although at first glance, she may be seemingly quiet and shy, she is certainly very far from that. After engaging in conversations with this silent powerhouse, I gathered that she is not only assertive and confident, but is charged with the great responsibility of managing the state-appointed agency - The Trinidad and Tobago Fashion Company Limited (FashionTT). FashionTT was established in 2013 with the mandate to stimulate and facilitate the business development and e', '', 0),
(1172, 'https://www.cnc3.co.tt/news/ramlogan-no-weapon-formed-against-me-will-prosper', 'Ramlogan: No weapon formed against me will prosper | CNC3', 'Former Attorney General Anand Ramlogan and his attorney Pamela Elder speak with members of the media outside of the court Monday morning.', '', 0),
(1173, 'https://www.cnc3.co.tt/news/bocas-literature-festival-writing-world', 'Bocas Literature Festival: Writing for the world | CNC3', 'Caribbean writers should not be afraid of taking their work to the world. That is the view of the award-winning fiction writer, Nalo Hopkinson as the Bocas literature festival opened today. Ryan Bachoo is leading our coverage on this literary extravaganza. Here\'s his day one report.', '', 0),
(1174, 'https://www.cnc3.co.tt/news/analysis-contradicts-unc-claim-poll-shift-benefits-pnm', 'Analysis contradicts UNC claim that poll shift benefits PNM | CNC3', 'Analysis of a shift in polling divisions in San Fernando West appears to contradict claims by the UNC that the Elections and Boundaries Commission is giving the PNM an advantage. Akash Samaroo shows us that the divisions aren\'t as much of a PNM stronghold as the UNC leader is alleging, and the EBC explains the rationale for the proposed changes.', '', 0),
