(1186, 'https://www.cnc3.co.tt/business-watch/business-watch-functional-csme-critical-growth', 'Business Watch: Functional CSME critical to growth | CNC3', 'Members of the private sector have realized that a functional CARICOM Single Market and Economy is necessary to stimulate economic growth. Today at the annual business meeting held by the Trinidad and Tobago Chamber of Industry and Commerce, private sector stakeholders discussed their concerns about the CSME implementation. Kyron Regis has more in tonight\'s Business Watch.', '', 0),
(1187, 'https://www.cnc3.co.tt/business-watch/business-watch-govt-says-paria-fuel-trading-company-not-sale', 'Business Watch: Gov\'t says Paria Fuel Trading Company not for sale | CNC3', 'The government has ordered all requests for proposal regarding the sale of Paria Fuel Trading Company to be withdrawn as the energy minister insists there is no intention to sell the company. The minister says the comments by Trinidad Petroleum Company chairman, parent company of Paria, about the sale were simply his personal opinion. More in Business Watch.', '', 0),
(1188, 'https://www.cnc3.co.tt/business-watch/energy-minister-confident-gas-sales-agreement-venezuela-will-go-ahead-once-conflict', 'Energy Minister confident gas sales agreement with Venezuela will go ahead once conflict is settled | CNC3', 'The energy minister says government feels confident that the gas sales agreement between Venezuela and this country will go ahead once the domestic conflict in Venezuela is settled. And this country is being praised for its work in reducing greenhouse gas emissions. Judy Kanhai has more in Business Watch.', '', 0),
(1189, 'https://www.cnc3.co.tt/business-watch/business-watch-concerns-over-cepeps-debt', 'Business Watch: Concerns over CEPEP\'s debt | CNC3', 'Concerns today over CEPEP\'s debt and its accountability to the public. The state enterprise appeared before a Joint Select Committee of Parliament today, where it was revealed that it has over 14 court matters after failing to pay contractors and suffered a curious server crash losing all its financial information, just weeks before new management took over the company. More from Melissa Williams-Sambrano.', '', 0),
(1190, 'https://www.cnc3.co.tt/business-watch/business-watch-trinidad-hotels-association-calls-airbnb-be-regulated-tt', 'Business Watch: Trinidad Hotels Association calls for Airbnb to be regulated in T&T | CNC3', 'The shortage of US currency has forced local companies to seek alternative sources to pay their international bills. It has already cost one company $6 million, a cost it says it cannot pass on to its customers. Also, most hotels, especially those in the Port-of-Spain areas are completely booked for Carnival. But according to the Trinidad Hotels, Restaurants and Tourism Association, an increasing number of visitors are opting for private accommodations through services like Airbnb. Judy Kanhai has more in B', '', 0),
(1191, 'https://www.cnc3.co.tt/business-watch/business-watch-cal-will-be-providing-fewer-seats-domestic-route-during-easter-month', 'Business Watch: CAL will be providing fewer seats on domestic route during Easter month | CNC3', 'Caribbean Airlines says it has been too busy to meet with the Tobago Hotel Association over the last several months but it is assuring that it\'s working on meeting with the association. This comes days after the Tobago Hotel Association said it requested a meeting with the airline five months ago. While the association has indicated a drop in domestic arrivals, Cal\'s flight schedule for the Easter period indicates that fewer seats will be provided. Judy Kanhai has the details in Business Watch.', '', 0),
(1192, 'https://www.cnc3.co.tt/business-watch/amcham-dragon-gas-deal-important-future-investments', 'AMCHAM: Dragon Gas deal important for future investments | CNC3', 'The CEO of the American chamber of commerce says the success of the dragon gas deal between T&T and Venezuela is important in attracting future investments in the local downstream sector. He believes that\'s why t&t should be reaching out to Venezuela\'s interim president Juan Guaido. Judy Kanhai has this and more in Business Watch. more about', '', 0),
(1193, 'https://www.cnc3.co.tt/business-watch/govt-revise-budgeted-oil-price-intl-price-drops', 'Gov\'t to revise budgeted oil price as int\'l price drops | CNC3', 'The Finance Minister says the government will be revising the budgeted oil price downwards in light of falling international prices. The reduced oil price has resulted in lower revenue for T&T over the last several months. And the government says there was no meeting scheduled with sandals today this follows speculation that the project might not be on the table again. Judy Kanhai has the details in Business Watch.', '', 0),
(1194, 'https://www.cnc3.co.tt/business-watch/business-watch-economist-questions-accuracy-pms-figures', 'Business Watch: Economist questions accuracy of PM\'s figures | CNC3', 'The prime minister came armed with graphs and figures when he apprised the country on its financial status. But one economist is questioning the accuracy of some of those statistics', '', 0),
(1195, 'https://www.cnc3.co.tt/business-watch/business-watch-increased-police-presence-chaguanas-christmas', 'Business Watch: Increased police presence in Chaguanas for Christmas | CNC3', 'With Christmas just around the corner. It\'s usually a busy period for businesses. As a result, the police are assuring that they will be out in full force in the borough of Chaguanas to protect shoppers and businesses. Judy Kanhai has the details in Business Watch.', '', 0),
(1196, 'https://www.cnc3.co.tt/business-watch/business-watch-business-groups-disappointed-political-grandstanding-over-tax-bill', 'Business Watch: Business groups disappointed with political \'grandstanding\' over tax bill | CNC3', 'Two business groups are saying they are disappointed that adjustments had to be made to the income tax amendment bill in order for it to be passed. The business groups say the actions by the government and the opposition were simply irresponsible. Judy Kanhai has the details in Business Watch.', '', 0),
(1197, 'https://www.cnc3.co.tt/business-watch/business-watch-opposition-accuses-govt-changing-deadline-passing-income-tax-amendment', 'Business Watch: Opposition accuses gov\'t of changing deadline for passing the income tax amendment bill | CNC3', 'The Opposition is accusing the government of continuously changing the deadline date for passing the income tax amendment bill. But the Bankers Association is telling the opposition that the bill was supposed to have been passed since it was in power. Judy Kanhai has the details in Business Watch.', '', 0),
(1198, 'https://www.cnc3.co.tt/business-watch/business-watch-deya-sales-not-good-usual', 'Business Watch: Deya sales not as good as usual | CNC3', 'We take a look at deya sales in the Central district. Jannelle Bernard tells us more.', '', 0),
(1199, 'https://www.cnc3.co.tt/business-watch/business-watch-barfi-cheesecake-big-hit-divali', 'Business Watch: Barfi cheesecake big hit for Divali | CNC3', 'One bakery has blended two sweets to create its own twist to the Indian delicacy, Barfi. Viaa says its Barfi cheesecake has become a popular hit for the Divali period. Judy Kanhai has the details in Business Watch.', '', 0),
