(1215, 'https://t.co/uk1w99hrOz', 'Mickela Panday launches Patriotic Front | CNC3', '\"Itâ€™s Time.\" That\'s the word from forÂ­mer Oropouche-West MP MickÂ­ela PanÂ­day. With the genÂ­erÂ­al elecÂ­tion due in 16 months, this is the mesÂ­sage that T&Tâ€™s newest poÂ­litÂ­iÂ­cal parÂ­ty lead by PanÂ­day is sendÂ­ing out as it promisÂ­es to revÂ­oÂ­luÂ­tionise govÂ­erÂ­nance by putting youths at the foreÂ­front. The PaÂ­triÂ­otÂ­ic Front held its launch in ChÂ­aguaÂ­nas toÂ­day and was conÂ­fiÂ­dent of formÂ­ing the next govÂ­ernÂ­ment. \"Itâ€™s a long time in polÂ­iÂ­tics, one year and four mont', '', 0),
