(1218, 'https://t.co/FekjTtIdaP', 'Last two escapees held!! | CNC3', 'The two last prison escapees have been recaptured. Olatungi Denbow and Michael Findley were held by a joint team representing the Special Operations Respond Team (SORT) and the Trinidad and Tobago Defence Force, just before 6pm today. They were recaptured in South Oropouche, just before Moruga. Authorities say the men were making plans to travel to Venezuela when they were captured. The exact circumstances surrounding their recapture are not yet clear but we will have further updates later. Up until Friday,', '', 0),
