(1221, 'https://t.co/HeeGDUwYF2', '\'Comfort\' coming with Venezuelans\' health in mind | CNC3', 'The US Navy hospital ship \'Comfort\' will visit Trinidad and Tobago soon during its upcoming medical support mission to Latin America to help tackle humanitarian crisis created by the influx of Venezuelan migrants, the US Southern Command said in a press release on Friday. The ship will make port calls in 11 countries in total. \"Comfort medical teams will pull in to Colombia, Costa Rica, Dominican Republic, Ecuador, Grenada, Haiti, Jamaica, Panama, Saint Lucia, St. Kitts and Nevis, and Trinidad and Tobago fo', '', 0),
(1222, 'https://t.co/LMLOSmzB5S', 'CNC3TV on Twitter: \"\'Comfort\' coming with Venezuelans\' health in mind | CNC3 https://t.co/HeeGDUwYF2â€¦ \"', '', '', 0),
(1223, 'https://twitter.com/CNC3TV/status/1132055590178611200', 'CNC3TV on Twitter: \"Pregnant woman, baby, among 17 Venezuelans found in abandoned Chatham hotel | CNC3 https://t.co/19XK01mfWRâ€¦ \"', '', '', 0),
(1224, 'https://t.co/19XK01mfWR', 'Pregnant woman, baby among 17 Venezuelans found in abandoned Chatham hotel | CNC3', 'Seventeen Venezuelans have been caught hiding in an abandoned hotel infested with bats and rats at Chatham South beach. They were picked up by the T&T Coast Guard after dawn, having been dropped off by a Venezuelan pirogue. Among the 17 Venezuelans were nine females, one of whom is pregnant, a baby and seven men. A source said the women were hiding in the abandoned hotel; while some were found in the bushes and on the beach. The patrolling officers became alerted when they saw a few cars, waiting to pick up', '', 0),
(1225, 'https://t.co/dOShP9ZxFR', 'CNC3TV on Twitter: \"Pregnant woman, baby, among 17 Venezuelans found in abandoned Chatham hotel | CNC3 https://t.co/19XK01mfWRâ€¦ \"', '', '', 0),
(1226, 'https://twitter.com/CNC3TV/status/1132041888884768769', 'CNC3TV on Twitter: \"US Ambassador observes his first US Memorial Day in T&T | CNC3 https://t.co/HMpPg9tWFRâ€¦ \"', '', '', 0),
(1227, 'https://t.co/HMpPg9tWFR', 'US Ambassador observes his first US Memorial Day in T&T | CNC3', 'US Ambassador Joseph Mondello, today participated in his first Memorial Day observances here in Trinidad and Tobago. Mondello, a military veteran, on Friday led the staff of the US Embassy Port-of-Spain in observing a moment of silence and laid a wreath to commemorate Memorial Day, observed in the United States on the last Monday in May. Ambassador Mondello said the day symbolized much more to him than the first day of summer, as he recalled reading the list of war casualties in the newspapers as a young bo', '', 0),
(1228, 'https://t.co/4T9F5iREXE', 'CNC3TV on Twitter: \"US Ambassador observes his first US Memorial Day in T&T | CNC3 https://t.co/HMpPg9tWFRâ€¦ \"', '', '', 0),
(1229, 'https://twitter.com/CNC3TV/status/1132038857837416449', 'CNC3TV on Twitter: \"$14.6 million in weed destroyed in Biche | CNC3 https://t.co/p8fpRJqv5Xâ€¦ \"', '', '', 0),
(1230, 'https://t.co/p8fpRJqv5X', '$14.6 million in weed destroyed in Biche | CNC3', 'Police have destroyed marijuana trees and dried marijuana worth an estimated $14.6 million. Officers of the Eastern Division conducted an eradication exercise in Biche on Friday when the drugs were found. The exercise was coordinated by Snr. Supt. (Ag.) Andy Belfon and included officers of the Organised Crime and Intelligence Unit and the Air Support Unit. During the exercise, officers discovered four marijuana fields on approximately nine lots of land, which contained a total of 14,300 fully grown marijuan', '', 0),
(1231, 'https://t.co/ufkJeZkSzI', 'CNC3TV on Twitter: \"$14.6 million in weed destroyed in Biche | CNC3 https://t.co/p8fpRJqv5Xâ€¦ \"', '', '', 0),
