(1233, 'https://t.co/ePeyvQ0Byx', 'Venezuelan families seek help | CNC3', 'Having endured a grueling boat ride from Tucupita to Trinidad and then several days of hiding in the forests of Palo Seco before their arrests, 17 Venezuelans have finally settled into a house at Morne Diablo, Penal. They have limited food, a trickle of water and no medicine for their sick children. Yet to them Trinidad is like a paradise. Compared to their homeland, there is no shortage of food here. The family gave Guardian Media an exclusive interview of their plight and their hopes for the future. The f', '', 0),
