(1236, 'https://t.co/T5lDFCin6F', 'Police want help finding teenager missing since May 2 | CNC3', 'Police are seeking the urgent assistance of the public in locating 18-year-old Rachel Barhoo. Barhoo, of Beckles Street, North Esperance, was last seen in the San Fernando district around 8:30 am on Thursday 2nd May, 2019. She was reported missing to the San Fernando Police Station, around 1 pm, on Wednesday 22nd May, 2019, by her mother. She is of East Indian descent, 5 feet 5 inches tall and medium built with a brown complexion and short black hair. She was last seen wearing a black t-shirt, a pair of blu', '', 0),
