(1239, 'https://t.co/GGsQVx3KRS', 'Chaguanas man appears in court charged with murder | CNC3', 'Dane Julien a 19-year-old Charlieville man has appeared before the Chaguanas Magistratesâ€™ Court, after being charged with the murder of Ganchan Diaz, which occurred in March 2019. Julien stood before Senior Magistrate Rajendra Rambhacan in the Chaguanas 1st Magistratesâ€™ Court, on May 23rd 2019, to answer to the charge. According to police reports, on March 10th, 23-year-old Diaz, a labourer of Charlieville, was walking along Assaraf Road, East Charlieville, with a friend when he was accosted by a man kn', '', 0),
