(1242, 'https://t.co/0GRa6xMWLh', 'Police release man held for questioning over escapees | CNC3', 'A man who was detained by officers of the Port-of-Spain Division Task Force Thursday night for questioning into the allegedly aiding and abetting of escapees Denbow Olatungi and Michael Findlay, was released shortly after 2pm Friday. Police held the man at his One Woodbrook Place apartment during an exercise. His common-law wife was also held and later released. Denbow and Findlay along with six other men escaped from the Golden Grove Remand Yard Prison in Arouca on May 15. The six other escapees were held ', '', 0),
