(1245, 'https://t.co/qWlAzLhl11', '46 Venezuelans in court for illegal entry | CNC3', 'Even as aid is beÂ­ing sought for more 100 VenezueÂ­lans miÂ­grants found hidÂ­ing in the PaÂ­lo Seco area, 46 othÂ­ers apÂ­peared in court this mornÂ­ing charged with enÂ­terÂ­ing the counÂ­try ilÂ­leÂ­galÂ­ly. The maÂ­jorÂ­iÂ­ty of them were conÂ­victÂ­ed and orÂ­dered to pay fines of $2,000 and $3,000. They were givÂ­en three months to pay the fines or serve six and four months in jail. Most were men and they came inÂ­to the counÂ­try at difÂ­ferÂ­ent dates beÂ­tween last AuÂ­gust and this month. AfÂ­ter', '', 0),
