(1248, 'https://t.co/0FnW5fqIHF', 'Young to Venezuelans: \'Don\'t allow anyone to talk you out of registering\' | CNC3', 'National Security Minister Stuart Young is sending a message to Venezuelan nationals in Trinidad and Tobago, \"do not to listen\" to those telling them to stay away from the registration process. At a news conference in Port-of-Spain on Friday, Minister Young said that it is in their own interest, because when the registration process is done, the state will revert to enforcing the law of deporting persons who are here illegally. He has made a fresh call for all Venezuelans, whether here legally or not, to co', '', 0),
