(1251, 'https://t.co/5eKWnW7Qid', 'Ailing nurse sues ministry for refusal of disability grant | CNC3', 'A nurse from SanÂ­gre Grande, sufÂ­ferÂ­ing from a rare auÂ­toimÂ­mune disÂ­ease has been grantÂ­ed perÂ­misÂ­sion to sue the MinÂ­istry of SoÂ­cial DeÂ­velÂ­opÂ­ment and FamÂ­iÂ­ly AfÂ­fairs and the CenÂ­tral PubÂ­lic AsÂ­sisÂ­tance Board over reÂ­fusÂ­ing to grant her a disÂ­abilÂ­iÂ­ty asÂ­sisÂ­tance grant. High Court Judge Eleanor DonÂ­aldÂ­son-HonÂ­eyÂ­well yesÂ­terÂ­day grantÂ­ed Ruth PeÂ­ters leave to purÂ­sue her juÂ­diÂ­cial reÂ­view against as the minÂ­istry and State board afÂ­ter rulÂ­ing that s', '', 0),
