(1254, 'https://t.co/UW6gxVOskk', 'Sangre Grande man missing | CNC3', 'The TTPS is seeking the urgent assistance of the public in locating 46-year-old Nicholas Roderick. Nicholas, of Paul Street, Sangre Grande, was last seen leaving home at 6:30 pm on November 3rd 2018. He was reported missing to the Sangre Grande Police Station on May 23rd. Nicholas is of African descent, 5 feet 8 inches tall, slim built, with a dark brown complexion and an afro hairstyle. Anyone with information on the whereabouts of Nicholas Roderick is asked to contact the police at 999, 911, 800-TIPS or a', '', 0),
