(1257, 'https://t.co/crIiEjiGo4', 'Police recover arms, ammunition in Central exercise | CNC3', 'Police officers have recovered illegal firearms along with live ammunition in an Intelligence-led operation in Central Trinidad on Thursday. A 60-year-old man was also arrested for possession of cocaine during the said operation. According to a police report, between 11 am and 8 pm on Thursday a party of officers assigned to the Central Division\'s Task Force acted on information received and went to an open parcel of land at Onyx Drive, Carlsen Field, where they found a revolver and three rounds of ammuniti', '', 0),
